import GitHubIcon from '@mui/icons-material/GitHub';
import LinkedInIcon from '@mui/icons-material/LinkedIn';
import EmailRoundedIcon from '@mui/icons-material/EmailRounded';

const Footer = () => {
    return (
        <div className="flex md:flex-row flex-col justify-evenly gap-3">

            <div className="md:w-1/2">
                <p className="md:text-xl text-lg font-bold">DIANNE MAE P FABIANO</p>
                <p className="md:text-lg text-base font-medium">Web Developer</p>
            </div>

            <div className="md:w-1/2 flex justify-end gap-4">
                <EmailRoundedIcon />
                <a
                    href='https://www.linkedin.com/in/dianne-fabiano/'
                    className='text-primary hover:text-secondary'
                >
                    <LinkedInIcon />
                </a>

                <a
                    href='https://github.com/fabianodianne'
                    className='text-primary hover:text-secondary'
                >
                    <GitHubIcon />
                </a>
            </div>

        </div>
    );
};

export default Footer;
